// These are the two filter fields {by Muscle, by Equipment} used in the Exercises page.

import React from 'react';
import './ExerciseFilters.css';

const ExerciseFilters = ({ onFilter }) => {
  return (
    <div class='dropdown'>
      <div class='dropdown-select' id='muscleDropdown'>
        <span class='selected-option'>Select Muscle</span>
        <ul class='dropdown-list'>
          <li data-value='muscle1'>Muscle 1</li>
          <li data-value='muscle2'>Muscle 2</li>
          <li data-value='muscle3'>Muscle 3</li>
        </ul>
      </div>
      <div class='dropdown-select' id='equipmentDropdown'>
        <span class='selected-option'>Select Equipment</span>
        <ul class='dropdown-list'>
          <li data-value='equipment1'>Equipment 1</li>
          <li data-value='equipment2'>Equipment 2</li>
          <li data-value='equipment3'>Equipment 3</li>
        </ul>
      </div>
    </div>
  );
};

export default ExerciseFilters;
